    "selected-aquifer-test-and-specific-capacity-data-for-wells-in-the-lost-creek-designated-ground-",nt"isopen":
    false,nt"url": null,nt"notes": "This point dataset contains estimates of
    aquifer transmissivity and hydraulic conductivity at selected well locations in
    the Lost Creek Designated Ground Water Basin, Weld, Adams, and Arapahoe Counties,
    Colorado. This dataset also contains hydrologic information used to estimate transmissivity
    from specific capacity at selected well locations. Data were compiled from published
    reports, consultant reports, and from well-test records on file with the U.S. Geological
    Survey and Colorado Division of Water Resources. The U.S. Geological Survey prepared
    this dataset in cooperation with the Colorado Geological Survey and the Lost Creek
    Ground Water Management District.",nt"license_title": null,nt"extras":
